import React from 'react';
import { Row, Col, Card, Table } from 'antd';
const dataSource = [];
const columns = [
	{
		title: 'Country',
		dataIndex: 'Country',
		key: 'Country'
	},

	{
		title: 'Country Code',
		dataIndex: 'Country Code',
		key: 'CountryCode'
	},
	{
		title: 'New Confirmed',
		dataIndex: 'NewConfirmed',
		key: 'NewConfirmed'
	},
	{
		title: 'Total confirmed',
		dataIndex: 'Totalconfirmed',
		key: 'Totalconfirmed'
	},
	{
		title: 'New Deaths',
		dataIndex: 'NewDeaths',
		key: 'NewDeaths'
	},
	{
		title: 'Total Deaths',
		dataIndex: 'TotalDeaths',
		key: 'TotalDeaths'
	},
	{
		title: 'New Recovered',
		dataIndex: 'NewRecovered',
		key: 'NewRecovered'
	},
	{
		title: 'Total Recovered',
		dataIndex: 'TotalRecovered',
		key: 'TotalRecovered'
	}
];
const CountriesVirus = () => {
	return (
		<Row>
			<Col span={24}>
				<Table dataSource={dataSource} columns={columns} />
			</Col>
		</Row>
	);
};
export default React.memo(CountriesVirus);
